import React, { useState } from 'react';
import { Outlet, Link } from 'react-router-dom';

export const Navegacion = () => {
  const [searchTerm, setSearchTerm] = useState('');

  const handleSearch = (event) => {
    setSearchTerm(event.target.value);
    // Aquí podrías realizar la lógica de búsqueda filtrando tu tabla
    // Puedes llamar a una función que filtre los productos según el término de búsqueda
    // Esta función podría estar en otro componente que maneje la tabla de productos
    // Ejemplo: handleFilterProducts(event.target.value);
  };

  return (
    <div>
      <nav className="navbar navbar-expand-lg bg-body-tertiary">
        <div className="container-fluid">
          <Link to="/inicio" className="navbar-brand">
            Supermercado
          </Link>
          <button
            className="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarSupportedContent"
            aria-controls="navbarSupportedContent"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <ul className="navbar-nav me-auto mb-2 mb-lg-0">
              <li className="nav-item">
                <Link to="/productos" className="nav-link active" aria-current="page">
                  Productos
                </Link>
              </li>
              <li className="nav-item">
                <Link to="/registrar" className="nav-link active" aria-current="page">
                  Registrar
                </Link>
              </li>
            </ul>
            <form className="d-flex" role="search">
              <input
                className="form-control me-2"
                type="search"
                placeholder="Buscar producto"
                aria-label="Search"
                value={searchTerm}
                onChange={handleSearch}
              />
              <button className="btn btn-outline-danger" type="submit">
                Search
              </button>
            </form>
          </div>
        </div>
      </nav>
      <Outlet />
    </div>
  );
};
